pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "@cncy/storage.contracts/contracts/StorageInterface.sol";
import "@cncy/storage.contracts/contracts/libraries/BytesListStorage.sol";

contract Orders {

    using BytesListStorage for StorageInterface;
    StorageInterface s = StorageInterface(0);

    uint8 public version = 1;

    event OrderAccepted(
        string orderId,
        uint createdDate,
        bytes32 itemsHash
    );

    event OrderDelayed(
        string orderId,
        string reason
    );

    event OrderCompleted(
        string orderId,
        uint completedDate
    );

    struct Order {
        string orderId;
        uint createdDate;
        bytes32 itemsHash;
        State state;
    }

    struct Delay {
        string reason;
    }

    enum State { Accepted, Delayed, Completed }

    constructor(address _storageAddress) public {
        s = StorageInterface(_storageAddress);
    }

    function createOrder(string memory _orderId, uint _createdDate, bytes32 _itemsHash) public {
        require(!orderExists(_orderId), "Order already exists");

        Order memory order = Order({
            orderId: _orderId,
            createdDate: _createdDate,
            itemsHash: _itemsHash,
            state: State.Accepted
        });

        saveOrder(order);
        s.setBool(abi.encodePacked("orders.exists", _orderId), true);

        emit OrderAccepted(_orderId, _createdDate, _itemsHash);
    }

    function delayOrder(string memory _orderId, string memory _reason) public exists(_orderId) {
        Order memory order = getOrder(_orderId);
        order.state = State.Delayed;

        saveOrder(order);

        Delay memory delay = Delay({
            reason: _reason
        });

        s.pushListItem(abi.encodePacked("orders.delays", _orderId), abi.encode(delay));

        emit OrderDelayed(_orderId, _reason);
    }

    function completeOrder(string memory _orderId, uint _completedDate) public exists(_orderId) {
        Order memory order = getOrder(_orderId);
        order.state = State.Completed;

        saveOrder(order);

        emit OrderCompleted(_orderId, _completedDate);
    }

    function getOrder(string memory _orderId) public view returns (Order memory) {
        bytes memory structBytes = s.getBytes(abi.encodePacked("orders.details", _orderId));
        return abi.decode(structBytes, (Order));
    }

    function getDelays(string memory _orderId) public view returns (Delay[] memory) {
        bytes memory key = abi.encodePacked("orders.delays", _orderId);
        uint count = s.getListCount(key);

        Delay[] memory delays = new Delay[](count);

        for (uint i = 0; i < count; i++) {
            bytes memory structBytes = s.getListItem(key, i);
            delays[i] = abi.decode(structBytes, (Delay));
        }

        return delays;
    }

    function saveOrder(Order memory _order) private {
        s.setBytes(abi.encodePacked("orders.details", _order.orderId), abi.encode(_order));
        s.setUint(abi.encodePacked("orders.details.version", _order.orderId), 1);
    }

    function orderExists(string memory _orderId) internal view returns (bool) {
        return s.getBool(abi.encodePacked("orders.exists", _orderId));
    }

    modifier exists(string memory _orderId) {
        require(orderExists(_orderId), "Order does not exist");
        _;
    }

}
